      "𝗋𝖾𝗉𝗅𝗒": "[\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖸𝖾𝗌 𝗆𝖺𝗇 𝖨 𝖼𝗋𝖾𝖺𝗍𝖾𝖽 𝗂𝗍 𝖿𝗋𝗈𝗆 𝗌𝖼𝗋𝖺𝗍𝖼𝗁\",\𝗇      \"𝗋𝖾𝗉𝗅𝗒\": \"𝖲𝗈𝗋𝗋𝗒, 𝖨'𝗆 𝗁𝖺𝗏𝗂𝗇𝗀 𝗍𝖾𝖼𝗁𝗇𝗂𝖼𝖺𝗅 𝖽𝗂𝖿𝖿𝗂𝖼𝗎𝗅𝗍𝗂𝖾𝗌 𝗋𝗂𝗀𝗁𝗍 𝗇𝗈𝗐! 🛠️ 𝖳𝗋𝗒 𝖺𝗀𝖺𝗂𝗇 𝗂𝗇 𝖺 𝖿𝖾𝗐 𝗆𝗂𝗇𝗎𝗍𝖾𝗌.\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟣𝟥𝟥𝟧𝟥𝟤𝟣𝟫𝟧𝟤𝟦𝟦𝟢@𝗅𝗂𝖽] 𝖭𝗂𝖼𝖾 𝖻𝗈𝗒 🥹🌚\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟪𝟤𝟦𝟪𝟫𝟩𝟨𝟤𝟨𝟧𝟤𝟤𝟢𝟦@𝗅𝗂𝖽] 𝖳𝖿\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟪𝟤𝟦𝟪𝟫𝟩𝟨𝟤𝟨𝟧𝟤𝟤𝟢𝟦@𝗅𝗂𝖽] 𝖫𝗈𝗇𝗇𝖾𝗋?\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟪𝟫𝟨𝟩𝟫𝟣𝟤𝟩𝟤𝟪𝟣𝟩𝟩𝟧@𝗅𝗂𝖽] 𝖶𝗁𝖺 𝗇🗿🌚\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟣𝟥𝟥𝟧𝟥𝟤𝟣𝟫𝟧𝟤𝟦𝟦𝟢@𝗅𝗂𝖽] 𝖧𝗎𝗁\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟪𝟤𝟦𝟪𝟫𝟩𝟨𝟤𝟨𝟧𝟤𝟤𝟢𝟦@𝗅𝗂𝖽] ??\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟪𝟤𝟦𝟪𝟫𝟩𝟨𝟤𝟨𝟧𝟤𝟤𝟢𝟦@𝗅𝗂𝖽] 𝖯𝗆\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖧𝗈𝗐\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖭𝗈𝗐 𝗎 𝗀𝗈 𝗌𝖺𝗒 𝗇𝗈𝗍 𝗎𝗌𝖾𝖿𝗎𝗅\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟣𝟥𝟥𝟧𝟥𝟤𝟣𝟫𝟧𝟤𝟦𝟦𝟢@𝗅𝗂𝖽] 𝖠𝗆\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟪𝟫𝟨𝟩𝟫𝟣𝟤𝟩𝟤𝟪𝟣𝟩𝟩𝟧@𝗅𝗂𝖽] [𝖬𝖾𝖽𝗂𝖺]\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟪𝟫𝟨𝟩𝟫𝟣𝟤𝟩𝟤𝟪𝟣𝟩𝟩𝟧@𝗅𝗂𝖽] 𝖶𝗁𝖺 !🗿\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] [𝖬𝖾𝖽𝗂𝖺]\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖭𝗈𝖾 𝖾𝗑𝗉𝗅𝖺𝗂𝗇 𝗍𝗈 𝗆𝖾 𝗁𝗈𝗐 𝗂𝗍 𝗂𝗌 𝗇𝗈𝗍 𝗎𝗌𝖾𝖿𝗎𝗅\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖭𝗈𝗐\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟤𝟣𝟨𝟢𝟨𝟩𝟦𝟢𝟨𝟥𝟣𝟫𝟩𝟢𝟢@𝗅𝗂𝖽] 𝖮𝗄\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\",\𝗇      \"𝗋𝖾𝗉𝗅𝗒\": \"𝖤𝗋𝗋𝗈𝗋 𝖿𝖾𝗍𝖼𝗁𝗂𝗇𝗀 𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗉𝗂𝗇𝗀\",\𝗇      \"𝗋𝖾𝗉𝗅𝗒\": \"𝗉𝗈𝗇𝗀! 🏓\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\",\𝗇      \"𝗋𝖾𝗉𝗅𝗒\": \"𝖤𝗋𝗋𝗈𝗋 𝖿𝖾𝗍𝖼𝗁𝗂𝗇𝗀 𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] !𝗁𝖾𝗅𝗉\"\𝗇   },\𝗇   {\𝗇      \"𝗍𝖾𝗑𝗍\": \"[𝖡𝗈𝗍] !𝗁𝗂𝗌𝗍𝗈𝗋𝗒\"\𝗇   }\𝗇]"
