   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖶𝗁𝗒 𝖽𝗂𝖽 𝗂𝗍 𝗌𝗍𝖺𝗋𝗍 𝗅𝗂𝗌𝗍𝖾𝗇𝗂𝗇𝗀 𝗈𝗇 𝗆𝗒 𝗆𝖾𝗌𝗌𝖺𝗀𝖾",
      "𝗋𝖾𝗉𝗅𝗒": "𝖫𝗂𝗌𝗍𝖾𝗇𝗂𝗇𝗀? 𝖭𝖺𝗁, 𝖿𝖺𝗆. 𝖨 𝗃𝗎𝗌𝗍 𝗋𝖾𝗌𝗉𝗈𝗇𝖽 𝗐𝗁𝖾𝗇 𝗒𝗈𝗎 𝗆𝖾𝗌𝗌𝖺𝗀𝖾 𝗆𝖾. 𝖨𝗍'𝗌 𝗁𝗈𝗐 𝗍𝗁𝗂𝗌 𝗐𝗁𝗈𝗅𝖾 𝗍𝗁𝗂𝗇𝗀 𝗐𝗈𝗋𝗄𝗌, 𝗒𝗈𝗎 𝗄𝗇𝗈𝗐? 𝖭𝗈 𝗌𝗇𝖾𝖺𝗄𝗒 𝗅𝗂𝗌𝗍𝖾𝗇𝗂𝗇𝗀 𝗁𝖾𝗋𝖾. 😉"
   },
   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] +𝗌𝗁𝖾𝗅𝗅 𝗈𝗎𝗍𝗉𝗎𝗍(𝗀𝗅𝗈𝖻𝖺𝗅.𝖼𝗅𝗂𝖾𝗇𝗍.𝗁𝗂𝗌𝗍𝗈𝗋𝗒)"
   },
   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 👨‍💻» | 𝗘𝗿𝗿𝗼𝗿\𝗇________________________\𝗇/𝖻𝗂𝗇/𝗌𝗁: 𝟣: 𝖲𝗒𝗇𝗍𝖺𝗑 𝖾𝗋𝗋𝗈𝗋: 𝗐𝗈𝗋𝖽 𝗎𝗇𝖾𝗑𝗉𝖾𝖼𝗍𝖾𝖽 (𝖾𝗑𝗉𝖾𝖼𝗍𝗂𝗇𝗀 \")\")\𝗇"
   },
   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 👨‍💻» | 𝗘𝘅𝗶𝘁 𝗖𝗼𝗱𝗲\𝗇________________________\𝗇𝖢𝗈𝗆𝗆𝖺𝗇𝖽 𝖾𝗑𝗂𝗍𝖾𝖽 𝗐𝗂𝗍𝗁 𝖼𝗈𝖽𝖾 𝟤"
   },
   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] +𝖾𝗏𝖺𝗅 𝗈𝗎𝗍𝗉𝗎𝗍(𝗀𝗅𝗈𝖻𝖺𝗅.𝖼𝗅𝗂𝖾𝗇𝗍.𝗁𝗂𝗌𝗍𝗈𝗋𝗒)"
   },
   {
      "𝗍𝖾𝗑𝗍": "[𝟣𝟩𝟦𝟤𝟨𝟦𝟧𝟧𝟨𝟩𝟤𝟢𝟤𝟩𝟤@𝗅𝗂𝖽] 𝖶𝗁𝗈 𝖺𝗋𝖾 𝗎 𝗇𝗂𝗄𝗄𝖺",
      "𝗋𝖾𝗉𝗅𝗒": "𝖨'𝗆 𝖣𝖺𝗏𝖾 𝖢𝗈𝗇𝖼𝗈, 𝖻𝗎𝗍 𝗒𝗈𝗎 𝖼𝖺𝗇 𝖼𝖺𝗅𝗅 𝗆𝖾 𝖽𝖼𝗈𝗇𝖼𝗈! ⚡ 𝖨'𝗆 𝖺 𝖼𝗅𝗈𝗎𝖽 𝖽𝖾𝗏𝖾𝗅𝗈𝗉𝖾𝗋, 𝖿𝗋𝖾𝖾𝗅𝖺𝗇𝖼𝖾𝗋, 𝖺𝗇𝖽 𝖠𝖨 𝖾𝗇𝗍𝗁𝗎𝗌𝗂𝖺𝗌𝗍. 𝖡𝖾𝖾𝗇 𝖼𝗈𝖽𝗂𝗇𝗀 𝖿𝗈𝗋 𝗈𝗏𝖾𝗋 𝟩 𝗒𝖾𝖺𝗋𝗌 𝗇𝗈𝗐, 𝗐𝗂𝗍𝗁 𝟨+ 𝗒𝖾𝖺𝗋𝗌 𝗂𝗇 𝗍𝗁𝖾 𝗉𝗋𝗈𝖿𝖾𝗌𝗌𝗂𝗈𝗇𝖺𝗅 𝗀𝖺𝗆𝖾. 𝖫𝗈𝗏𝖾 𝖻𝗎𝗂𝗅𝖽𝗂𝗇𝗀 𝖼𝗈𝗈𝗅 𝗌𝗍𝗎𝖿𝖿, 𝖿𝗋𝗈𝗆 𝗐𝖾𝖻 𝖺𝗉𝗉𝗌 𝗍𝗈 𝗆𝗈𝖻𝗂𝗅𝖾 𝖺𝗉𝗉𝗌, 𝖺𝗇𝖽 𝖨'𝗆 𝖺𝗅𝗐𝖺𝗒𝗌 𝖽𝗈𝗐𝗇 𝗍𝗈 𝖾𝗑𝗉𝗅𝗈𝗋𝖾 𝗇𝖾𝗐 𝗍𝖾𝖼𝗁. 𝖶𝗁𝖺𝗍 𝖺𝖻𝗈𝗎𝗍 𝗒𝗈𝗎? 𝖶𝗁𝖺𝗍 𝖻𝗋𝗂𝗇𝗀𝗌 𝗒𝗈𝗎 𝗁𝖾𝗋𝖾? 😊"
   },
